    return (
        <div className="navbar">
            <img src="../images/logo.png" alt="" /> 
            <h1 className="title">Budget Thing</h1>
           <div className="navbar-buttons">
                <button type="">Create</button> 
                <button type="">History</button>
           </div> 
        </div>
    )
}
